import Main from '../components/layout/Main'
import { useTheme } from '../hooks/themeHooks'

export default function Home() {
  const { isDarkMode, changeMode } = useTheme()
  return (
    <Main>
      <button onClick={() => changeMode(!!isDarkMode) }>Alterar Theme {isDarkMode ? 'LIGHT' : 'DARK' } </button>
    </Main>
  )
}
